import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

import hmnlogo from './logoGroup.png';

const Button = styled.button`
  background-color: black;
  color: white;
  font-size: 20px;
  padding: 10px 60px;
  border-radius: 5px;
  margin: 10px 0px;
  cursor: pointer;
  &:disabled {
    color: grey;
    opacity: 0.7;
    cursor: default;
  }
`;

function NavBar() {
  return (
    <Navbar bg="white" variant="dark" display="flex">
        <Container>
          <Navbar.Brand href="#">
            <img
              alt=""
              src={hmnlogo}
              height="28px"
              margin-top="20px"
              margin-bottom="20px"
              text-align="left"
              className="d-inline-block align-top"
            />{' '}
          </Navbar.Brand>
        <Button margin-left="10px" border>
          BETA
        </Button>    
          <Navbar.Text margin-bottom="20px">
            Signed in as: <a href="#login">Mark Otto</a>
          </Navbar.Text>
        </Container>
      </Navbar>

  )
}

export default NavBar;
